import Header from "./Header";

const layoutStyle = {
  border: "1px solid #DDD",
  maxWidth: "80%",
  margin: "auto",
  padding: "3rem",
  fontSize: "3rem"
};

const Layout = props => (
  <div style={layoutStyle}>
    <Header />
    {props.children}
  </div>
);

export default Layout;
